        public void DeepCopyIn(
            IOutfit item,
            IOutfitGetter rhs,
            ErrorMaskBuilder? errorMask,
            TranslationCrystal? copyMask,
            bool deepCopy)
        {
            base.DeepCopyIn(
                (IFallout4MajorRecord)item,
                (IFallout4MajorRecordGetter)rhs,
                errorMask,
                copyMask,
                deepCopy: deepCopy);
            if ((copyMask?.GetShouldTranslate((int)Outfit_FieldIndex.Items) ?? true))
            {
                errorMask?.PushIndex((int)Outfit_FieldIndex.Items);
                try
                {
                    if ((rhs.Items != null))
                    {
                        item.Items = 
                            rhs.Items
                            .Select(r => (IFormLink<IOutfitTargetGetter>)new FormLink<IOutfitTargetGetter>(r.FormKey))
                            .ToExtendedList<IFormLink<IOutfitTargetGetter>>();
                    }
                    else
                    {
                        item.Items = null;
                    }
                }
                catch (Exception ex)
                when (errorMask != null)
                {
                    errorMask.ReportException(ex);
                }
                finally
                {
                    errorMask?.PopIndex();
                }
            }
        }
        
